 <h2>전팸</h2>
 <p><ul>
   <li>양락 : 신입생들이 많이 들어와서 흐뭇해한다. 근무환경이 좋아보인다.</li>
   <li>덩주 : 코로나의 주범. 발목부상으로 안그래도 못하는 축구 더 허접해졌을듯.</li>
   <li><a href="https://youtu.be/XqwprI1QCgU" target="blank">복킹</a> : 문판다고 나댄다. 축구할때는 더 나댄다.</li>
   <li>개충 : 머리는 점점 짧게 자르는데 턱은 점점 길어지는거 같다. 딸 낳고 요즘 기분 좋은듯.</li>
   <li>재기 : 주식과 코인투자로 바쁘다. 따지는 못하고있다. 야구겜도 계속하고있던데 일은 언제하는지 모르겠다.</li></ul>
    </p>
